import React from "react";
import { YMaps, Map, Placemark } from '@pbe/react-yandex-maps';

const YaMap = () => {

    //const [zoom, setZoom] = React.useState(17);
    //const mapState = React.useMemo(
     // () => ({ center: [56.779816, 60.548759], zoom, controls: ["zoomControl", "fullscreenControl"] }),
    // [zoom]
   // );

    return(
        <YMaps
            query={{
                ns: "use-load-option",
                load: "Map,Placemark,control.ZoomControl,control.FullscreenControl,geoObject.addon.balloon",
            }}
        >
            <div>
                <Map defaultState={{ center: [56.779816, 60.548759], zoom: 17, controls: ["zoomControl", "fullscreenControl"] }} width='100%' height='40rem'>
                    <Placemark defaultGeometry={[56.779816, 60.548759]} />
                </Map>
            </div>
        </YMaps>
    )
}

export default YaMap;
